const Contact = () => {
  return (
    <div className='contact-info'>
      <h1>Contact</h1>

      <p className='quote'>
        "Hello, I'm Brian, the founder, that draws upon my 25 years as a User
        Interface Engineer. I have chosen to pivot towards my passion from
        crafting aesthetically pleasing <strong>online interfaces</strong> to my
        passion for crafting aesthetically pleasing
        <strong>outdoor spaces</strong>. It is cool to embark on this journey,
        staying true to my values and the pursuit of growth."
      </p>
      <p>
        <strong>Email:</strong>{' '}
        <a href='mailto:info.curbAppeal@gmail.com'>info.curbAppeal@gmail.com</a>
      </p>
    </div>
  );
};

export default Contact;
